import React from 'react';
import logo from './logo.svg';
import './App.css';
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import { Routes, Route, Link } from 'react-router-dom';
import TwoFactorAuth from './components/auth/TwoFactorAuth';
function App() {
  return (
    <div>
      {/* Add a Navigation Bar or Links */}


      {/* Define Routes for Login, Register, and TwoFactorAuth */}
      <Routes>
        {/* Default route for login */}
        <Route path="/" element={<div className='flex items-center'><Login /></div>} />

        {/* Separate routes for Register and TwoFactorAuth */}
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/verify-otp" element={<TwoFactorAuth />} />
      </Routes>
    </div>
  );
}


export default App;
